import React from "react";
import "./style.css";

function SearchResults(props) {
  return (
    <div className="list-group search-results">
      {props.location.map((results) => (
        <div key={results} className="list-group-item">
          <img alt={results} src={results} /> &nbsp;
          <strong>Name:</strong> {results} &nbsp;
          <strong>Location:</strong> {results} &nbsp;
          <strong>Email:</strong> {results} &nbsp;
          <strong>Cell:</strong> {results}
        </div>
      ))}
    </div>
  );
}

export default SearchResults;
